import React, { useState } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";
import { Link } from "react-router-dom";

const useStyles = makeStyles({
  root: {
    minWidth: 275,
    maxWidth: 1000,
    minHeight: 500,
  },
  bullet: {
    display: "inline-block",
    margin: "0 5px",
    transform: "scale(0.8)",
  },
  title: {
    fontSize: 30,
    fontWeight: "bold",
    paddingLeft: 200,
  },
  pos: {
    marginBottom: 12,
  },
  span: {
    paddingLeft: 190,
  },
});

function BookingScreen(props) {
  const classes = useStyles();
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");

  const redirect = props.location.search
    ? props.location.search.split("=")[1]
    : "/";

  const submitHandler = () => {};

  return (
    <div className="form-topview">
      <Card className={classes.root}>
        <CardContent>
          <Typography
            className={classes.title}
            color="textSecondary"
            gutterBottom
          >
            Register For Vaccination
          </Typography>

          <div className="form-midview">
            <p>
              Your Photo ID will be verified at the time of your vaccination
              appointment. Please provide the details <br />
              <span className={classes.span}>
                of the Photo ID you will carry for vaccination
              </span>
            </p>
            <form className="form" onSubmit={submitHandler}>
              <div>
                <label htmlFor="name">Name</label>
                <input
                  type="text"
                  id="name"
                  placeholder="Enter name"
                  required
                  onChange={(e) => setName(e.target.value)}
                ></input>
              </div>
              <div>
                <label htmlFor="email">Phone Number</label>
                <input
                  type="Number"
                  id="email"
                  placeholder="Enter Mobile Number"
                  required
                  onChange={(e) => setEmail(e.target.value)}
                ></input>
              </div>
              <div>
                <label htmlFor="email">Phone Number</label>
                <input
                  type="email"
                  id="email"
                  placeholder="Enter Mobile Number"
                  required
                  onChange={(e) => setEmail(e.target.value)}
                ></input>
              </div>
              <div>
                <label htmlFor="email">Phone Number</label>
                <input
                  type="email"
                  id="email"
                  placeholder="Enter Mobile Number"
                  required
                  onChange={(e) => setEmail(e.target.value)}
                ></input>
              </div>

              <div>
                <label />
                <button className="primary" type="submit">
                  Register
                </button>
              </div>
              <div>
                <label />
              </div>
            </form>
          </div>
        </CardContent>
      </Card>
    </div>
  );
}

export default BookingScreen;
